ith user data</h3><h3>Industry regulatory disclosure requirements</h3>', 'Privacy Policy', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2018-06-01 06:07:08', '2018-06-01 06:07:08', '', 0, 'http://localhost/dental_2/?page_id=3', 0, 'page', '', 0),
