nt=\"center\"][/et_pb_divider][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" next_background_color=\"#ffffff\" _builder_version=\"3.3.1\" background_color=\"#d3d3d3\" custom_padding=\"50.5156px|0px|95px|0px|false|false\" bottom_divider_style=\"arrow2\" bottom_divider_height=\"91px\" bottom_divider_flip=\"vertical\"][et_pb_row custom_padding=\"25.25px|0px|0|0px|false|false\" _builder_version=\"3.3.1\"][et_pb_column type=\"2_3\" _builder_version=\"3.3.1\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.3.1\" text_font=\"|700|||||||\" text_font_size=\"50px\" text_font_size_tablet=\"40px\" text_font_size_phone=\"30px\" text_font_size_last_edited=\"on|desktop\" text_line_height=\"1em\" header_font=\"||||||||\" header_font_size=\"31px\" text_orientation=\"center\" custom_margin=\"|||-100px\"]<p>    A Few Words About Us</p>[/et_pb_text][et_pb_text _builder_version=\"3.3.1\" text_font=\"||||||||\" text_text_color=\"#000000\" text_font_size=\"15px\" text_font_size_tablet=\"13px\" text_font_size_phone=\"13px\" text_font_size_last_edited=\"on|phone\" max_width_tablet=\"100%\" max_width_phone=\"100%\" max_width_last_edited=\"on|phone\"]<p>We are a family focused dental practice, founded in 1997 with a strong emphasis on preventive care and general dentistry to help you and your family achieve and keep a healthy smile for life. During your consultation, we like to take the time to discuss with you all the options available to solve your dental problems so we can provide the treatment that is the most suitable for you. We are committed to attending continuous education courses and seminars covering all areas of dentistry in order to ensure that all patients receive the best and most current treatments available.</p>\n<p>Our experienced staff members are dedicated to providing friendly, comfortable and professional dental care using all the latest technology to ensure your smile is always at its best</p>[/et_pb_text][/et_pb_column