|\" text_font_size_tablet=\"13px\" text_font_size_phone=\"12px\" text_font_size_last_edited=\"on|phone\"]<p>We are a family focused dental practice, founded in 1997 with a strong emphasis on preventive care and general dentistry to help you and your family achieve and keep a healthy smile for life. During your consultation, we like to take the time to discuss with you all the options available to solve your dental problems so we can provide the treatment that is the most suitable for you. We are committed to attending continuous education courses and seminars covering all areas of dentistry in order to ensure that all patients receive the best and most current treatments available.</p>\n<p>Our experienced staff members are dedicated to providing friendly, comfortable and professional dental care using all the latest technology to ensure your smile is always at its best</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.3.1\" parallax=\"off\" parallax_method=\"on\"][et_pb_image src=\"http://localhost/dental_2/wp-content/uploads/2018/06/doctor_PNG16003.png\" module_class=\"img1\" _builder_version=\"3.3.1\" custom_css_main_element=\"width:100%;||margin-left:30%!important;||margin-top:-35px;\"][/et_pb_image][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"3.3.1\"][/et_pb_section]', 'General Info', '', 'inherit', 'closed', 'closed', '', '58-revision-v1', '', '', '2018-06-01 13:12:46', '2018-06-01 13:12:46', '', 58, 'http://localhost/dental_2/2018/06/01/58-revision-v1/', 0, 'revision', '', 0),
