d services.</span>We go to any lenghts possible to make sure your smile stay bright and healthier than ever.</p>\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.3.1\"][et_pb_column type=\"4_4\" _builder_version=\"3.3.1\" parallax=\"off\" parallax_method=\"on\"][et_pb_tabs border_radii=\"on|12px|12px|12px|12px\" box_shadow_style=\"preset6\" box_shadow_color=\"#adadad\" _builder_version=\"3.3.1\" box_shadow_blur=\"16px\" box_shadow_spread=\"-1px\" border_color_all=\"#73d5a2\" border_width_all=\"-2px\" tab_font=\"||||||||\"][et_pb_tab title=\"General Dentistry\" _builder_version=\"3.3.1\" tab_font=\"|700|||||||\" tab_text_color=\"#46C1D1\" body_font=\"||||||||\" tab_font_size=\"20px\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<p>&nbsp;</p>\n<div>\n<h1 id=\"1\">General Dentistry</h1>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/general.jpg\" /></p>\n<p id=\"2\">Dental implants are a permanent solution to missing teeth that are quickly becoming the solution of choice as over traditional dentures. Dental implants feel and look more natural than dentures and can be used to replace one or more of your missing teeth. Our dentists are experienced in dental implant procedures and are here to help.</p>\n</div>\n</div>\n</div>[/et_pb_tab][et_pb_tab title=\"Cosmetic Dentistry\" _builder_version=\"3.3.1\" tab_font=\"|700|||||||\" tab_font_size=\"20px\" tab_text_color=\"#46C1D1\"]<h1 id=\"1\">Cosmetic Dentistry</h1>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/cosmetic.jpg\" /></p>\n<p id=\"2\">Smile, it\'s a great thing to do! With the advanced techniques in cosmetic dentistry that are offered at our dental clinic we are sure to provide you with a smile you will be proud of. Our team has helped many of our patients correct gaps, chips, stains and missing teeth with cosmetic procedures. The dentists of Denta-C will be happy to outline your personalized cosmetic dentistry treatment plan and explain all your options.Take the first step towards enhancing your smile and schedule your cosmetic dentistry exam today at 1-800-1234-567</p>\n[/et_pb_tab][et_pb_tab title=\"Dental Implants\" _builder_version=\"3.3.1\" tab_font=\"|700|||||||\" tab_font_size=\"20px\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<div>\n<h1 id=\"1\">Dental Implants</h1>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/implant1.jpg\" /></p>\n<p id=\"2\">Dental implants are a permanent solution to missing teeth that are quickly becoming the solution of choice as over traditional dentures. Dental implants feel and look more natural than dentures and can be used to replace one or more of your missing teeth. Our dentists are experienced in dental implant procedures and are here to help.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n[/et_pb_tab][et_pb_tab _builder_version=\"3.3.1\" tab_font=\"||||||||\" tab_font_size=\"20px\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_tab][et_pb_tab title=\"Tab Title\" _builder_version=\"3.3.1\" tab_font=\"||||||||\" tab_font_size=\"20px\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_tab][et_pb_tab title