>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Dental Implants\" _builder_version=\"3.3.1\" open=\"on\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/implant1.jpg\" /></p>\n<p id=\"2\">Dental implants are a permanent solution to missing teeth that are quickly becoming the solution of choice as over traditional dentures. Dental implants feel and look more natural than dentures and can be used to replace one or more of your missing teeth. Our dentists are experienced in dental implant procedures and are here to help.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Teeth Whitening\" _builder_version=\"3.3.1\" open=\"off\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<div>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/whitening.jpg\" /></p>\n<p id=\"2\">Our teeth whitening services are different from those of other clinics in:<br />Professional Whitening Systems Usage<br />Affordable Price<br />Dedication of our Dentists<br />Almost no Side Effects<br />Guaranteed Result<br />Perfect Smile<br />Various Whitening Products<br />Both In-Office and Over-The-Counter Whitening<br />Long-Lasting Effect.</p>\n</div>\n</div>\n</div>\n<div class=\"et_pb_button_module_wrapper et_pb_module et_pb_button_alignment_center\"></div>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Dental Crowns\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/crown.jpg\" /></p>\n<p id=\"2\">When a tooth has been damaged by a cavity, we will most likely perform a root canal to remove the infected tooth pulp. To restore functionality and appearance, and to seal the tooth from further damage, a dental crown will then be placed over the entire tooth surface.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Dentures\" _builder_version=\"3.3.1\" open=\"off\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility<br />Aesthetics</p>\n</div>\n</div>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Minor Oral Surgery\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Peizosurgery\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Periodontal Therapy\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Restorative Dentistry\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Preventive Dentistry\" _builder_version=\"3.3.1\" open=\"off\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by missing teeth can cause problems with eating and speech, and teeth either side of the gap may grow into the space at an angle. Installing dentures has a lot of advantages, including:<br />No dietary restrictions<br />Health improvement<br />Cost-effectiveness<br />Versatility</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Child care Dentistry\" _builder_version=\"3.3.1\" open=\"off\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_accordion_item][et_pb_accordion_item title=\"Laser Dentistry\" _builder_version=\"3.3.1\" open=\"off\"]<p>Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"Minimally Invasive Dentistry\" _builder_version=\"3.3.1\" open=\"off\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_accordion_item][et_pb_accordion_item title=\"Orthodontics\" _builder_version=\"3.3.1\" open=\"off\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_accordion_item][et_pb_accordion_item title=\"Periodontal Plastic Surgery\" _builder_version=\"3.3.1\" open=\"off\"]Your content goes here. Edit or remove this text inline or in the module Content settings. You can also style every aspect of this content in the module Design settings and even apply custom CSS to this text in the module Advanced settings.[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section]', 'CSERVICES', '', 'inherit', 'closed', 'closed', '', '37-revision-v1', '', '', '2018-06-02 10:38:31', '2018-06-02 10:38:31', '', 37, 'http://localhost/dental_2/2018/06/02/37-revision-v1/', 0, 'revision', '', 0);
