services.</span>We go to any lenghts possible to make sure your smile stay bright and healthier than ever.</p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.3.1\"][et_pb_column type=\"4_4\" _builder_version=\"3.3.1\" parallax=\"off\" parallax_method=\"on\"][et_pb_accordion _builder_version=\"3.3.1\" toggle_font=\"||||||||\" border_radii=\"on|20px|20px|20px|20px\" border_width_all=\"2px\" border_color_all=\"#73D5A2\" box_shadow_style=\"preset6\"][et_pb_accordion_item title=\"General Dentistry\" open=\"off\" open_toggle_text_color=\"#0c71c3\" open_toggle_background_color=\"#efefef\" closed_toggle_text_color=\"#000000\" icon_color=\"#46C1D1\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p>General Dentistry</p>\n<div>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/general.jpg\" /></p>\n<p id=\"2\">Dental implants are a permanent solution to missing teeth that are quickly becoming the solution of choice as over traditional dentures. Dental implants feel and look more natural than dentures and can be used to replace one or more of your missing teeth. Our dentists are experienced in dental implant procedures and are here to help.</p>\n</div>[/et_pb_accordion_item][et_pb_accordion_item title=\"Cosmetic Dentistry\" open=\"off\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<h1 id=\"1\">Cosmetic Dentistry</h1>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/cosmetic.jpg\" /></p>\n<p id=\"2\">Smile, it\'s a great thing to do! With the advanced techniques in cosmetic dentistry that are offered at our dental clinic we are sure to provide you with a smile you will be proud of. Our team has helped many of our patients correct gaps, chips, stains and missing teeth with cosmetic procedures. The dentists of Denta-C will be happy to outline your personalized cosmetic dentistry treatment plan and explain all your options.Take the first step towards enhancing your smile and schedule your cosmetic dentistry exam today at 1-800-1234-567</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"Dental Implants\" open=\"on\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/implant1.jpg\" /></p>\n<p id=\"2\">Dental implants are a permanent solution to missing teeth that are quickly becoming the solution of choice as over traditional dentures. Dental implants feel and look more natural than dentures and can be used to replace one or more of your missing teeth. Our dentists are experienced in dental implant procedures and are here to help.</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"Teeth Whitening\" open=\"off\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<div>\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/whitening.jpg\" /></p>\n<p id=\"2\">Our teeth whitening services are different from those of other clinics in:<br />Professional Whitening Systems Usage<br />Affordable Price<br />Dedication of our Dentists<br />Almost no Side Effects<br />Guaranteed Result<br />Perfect Smile<br />Various Whitening Products<br />Both In-Office and Over-The-Counter Whitening<br />Long-Lasting Effect.</p>\n</div>\n</div>\n</div>\n<div class=\"et_pb_button_module_wrapper et_pb_module et_pb_button_alignment_center\"></div>[/et_pb_accordion_item][et_pb_accordion_item title=\"Dental Crowns\" open=\"off\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/crown.jpg\" /></p>\n<p id=\"2\">When a tooth has been damaged by a cavity, we will most likely perform a root canal to remove the infected tooth pulp. To restore functionality and appearance, and to seal the tooth from further damage, a dental crown will then be placed over the entire tooth surface.</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"Dentures\" open=\"off\" _builder_version=\"3.3.1\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<div class=\"et_pb_with_border et_pb_module et_pb_text et_pb_text_3 h1 et_animated et_pb_bg_layout_light  et_pb_text_align_left slideRight\">\n<div class=\"et_pb_text_inner\">\n<p><img id=\"img\" src=\"http://localhost/demo/wp-content/uploads/2018/05/dentature.jpg\" /></p>\n<p id=\"2\">Dentures are removable false teeth made of acrylic (plastic), nylon or metal. They fit snugly over the gums to replace missing teeth and eliminate potential problems caused by gaps. Gaps left by miss