atments available.</p>\n<p>Our experienced staff members are dedicated to providing friendly, comfortable and professional dental care using all the latest technology to ensure your smile is always at its best</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_3\" _builder_version=\"3.3.1\" parallax=\"off\" parallax_method=\"on\"][et_pb_image src=\"http://localhost/dental_2/wp-content/uploads/2018/06/doctor_PNG16003.png\" module_class=\"img1\" _builder_version=\"3.3.1\" max_width_tablet=\"50%\" max_width_phone=\"40%\" max_width_last_edited=\"on|phone\" custom_css_main_element=\"width:100%;||margin-left:30%!important;||margin-top:-35px;\"][/et_pb_image][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"3.3.1\"][/et_pb_section]', 'General Info', '', 'inherit', 'closed', 'closed', '', '58-revision-v1', '', '', '2018-06-04 05:40:39', '2018-06-04 05:40:39', '', 58, 'http://localhost/dental_2/2018/06/04/58-revision-v1/', 0, 'revision', '', 0);
